TestCase("[Media Recorder] Addon State Tests", {
    setUp: function () {
        this.presenter = AddonMedia_Recorder_create();

        let internalElements = this.presenter._internalElements();

        this.state = new internalElements.AddonState();
        this.presenter.mediaRecorder.addonState = this.state;

        this.presenter.mediaRecorder.firstTrial = false;
    },

    "test new getState after added MP3ConvertHandler to AddonState returns this same state": function () {
        // Given
        let oldState = getMediaRecorderStateV1();
        this.presenter.setState(oldState);

        // When
        let newState = this.presenter.getState();

        // Then
        assertEquals(oldState, newState);
    },

});

function getMediaRecorderStateV1() {
    return `{"recording":"data:audio/wav;base64,","visibility":null,"enabled":null}`;
}